INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(1, 0, 'd_twig_manager', 'd_twig_manager', 'Dreamvention', '2.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_twig_manager</name>\n    <code>d_twig_manager</code>\n    <description>Adds support for twig templating engine</description>\n    <version>2.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path=\"system/engine/loader.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$template = new Template($this->registry->get(\'config\')->get(\'template_engine\'));]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            $template = new Template($this->registry->get(\'config\')->get(\'template_engine\'), $this->registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/template.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[public function __construct($adaptor) {]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($adaptor, $registry) {\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$this->adaptor = new $class();]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            $this->adaptor = new $class($registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/template/twig.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[private $data = array();]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            private $registry = array();\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[public function __construct() {]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($registry) {\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[\\Twig_Autoloader::register();]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            $this->registry = $registry;\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$this->twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $this->twig->addExtension(new \\Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"catalog/controller/event/theme.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $twig->addExtension(new Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2020-04-15 11:07:40'),
(2, 0, 'd_quickcheckout', 'd_quickcheckout', 'Dreamvention', '7.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_quickcheckout</name>\n    <code>d_quickcheckout</code>\n    <description>Ajax Quick Checkout default checkout replacement script</description>\n    <version>7.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path=\"catalog/controller/checkout/checkout.php\">\n        <operation>\n            <search ><![CDATA[$data[\'header\'] = $this->load->controller(\'common/header\');]]></search>\n            <add position=\"before\"><![CDATA[\n        if($this->config->get(\'d_quickcheckout_status\')){\n            $data[\'d_quickcheckout\'] = $this->load->controller(\'extension/module/d_quickcheckout\');\n        }\n        ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/cart/tax.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[final class Tax {]]></search>\n            <ignoreif><![CDATA[//a_vqmod_d_quickcheckout.xml]]></ignoreif>\n            <add position=\"after\"><![CDATA[\n    //a_vqmod_d_quickcheckout.xml\n    public function clearRates(){\n        $this->tax_rates = array();\n    }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/tax.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[final class Tax {]]></search>\n            <ignoreif><![CDATA[//a_vqmod_d_quickcheckout.xml]]></ignoreif>\n            <add position=\"after\"><![CDATA[\n    //a_vqmod_d_quickcheckout.xml\n    public function clearRates(){\n        $this->tax_rates = array();\n    }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/cart.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[foreach ($this->session->data[\'cart\'] as $key => $quantity) {]]></search>\n            <ignoreif><![CDATA[//a_vqmod_d_quickcheckout.xml]]></ignoreif>\n            <add position=\"before\"><![CDATA[\n    //a_vqmod_d_quickcheckout.xml\n    unset($this->session->data[\'cart\'][\'products\']);\n            ]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2020-04-15 11:08:25');
